import { robots } from "./robots";
import { Card } from "./Card";

export const CardsList = ({use})=>{
    const cardsArray = props.users.map((user, i)=>{
        return (<Card key={user.id} id={user.id} email={user.email} name={user.name}/>)
    })
    return(
        {cardsArray}
    )
}
